/*
 * Table accessor.
 */
idn__script_t
idn__sparsemap_getscript(unsigned long v) {
	int idx0, idx1, idx2;

	if (v > UTF32_MAX)
		return (idn__script_unknown);
	idx0 = v >> (SCRIPT_BITS_1 + SCRIPT_BITS_2);
	idx1 = (v >> SCRIPT_BITS_2) & ((1 << SCRIPT_BITS_1) - 1);
	idx2 = v & ((1 << SCRIPT_BITS_2) - 1);
	return (idn__script_t) script_table[script_imap[script_imap[idx0] + idx1]].tbl[idx2];
}
